/**
  Podcast.js
  @author Ethan Mil
  @version 1.0.0

  A React component that defines a podcast with the attributes of season (an integer), episode (an integer), and episodeTitle (a string).
*/

import React from 'react';

const Podcast = ({ season, episode, episodeTitle }) => {
  const displayEpisode = season !== undefined ? `Season ${season} Episode ${episode}` : `Episode ${episode}`;

  return (
    <div>
      <h2>{displayEpisode}</h2>
      <p>Episode Title: {episodeTitle}</p>
    </div>
  );
}

export default Podcast;
